import React from 'react';
import './Cell.css';
import { Rect } from 'react-konva';

const Cell = (props: any)  => {
  return (
    <Rect
        className="Cell"
        x={props.x}
        y={props.y}
        width={50}
        height={50}
        fill="white"
        shadowBlur={50}
    />
  );
}

export default Cell;
